import React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { Button, Link, Typography } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import '../App.css';
import { Input } from '@mui/base';
import SearchBar from './SearchBar';
import Avatar from '@mui/material/Avatar';
import PersonIcon from '@mui/icons-material/Person';
import ContentCutIcon from '@mui/icons-material/ContentCut';
import VideoCallIcon from '@mui/icons-material/VideoCall';

// import SearchBar from "material-ui-search-bar";



const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    '& .MuiButton-root': {
        marginTop: theme.spacing(1), // Add margin top to all buttons
        textTransform: 'none', // Remove text decoration from all buttons
        // fontSize: '10px'
    },
  }));


export default function Dashboard() {


    return (
        <>
            <Grid container sx={{ position: 'relative'}}>

                <Grid item xs={2} >
                    <Item>
                        <Typography variant='h4' sx={{ display:'flex', justifyContent:'center', alignItems:'center'}}>Logo</Typography>
                        <Box className='button' sx={{ display:'flex', flexWrap:'wrap', flexDirection:'column', alignItems:'center', justifyContent:'center'}}>
                            <Button variant="outlined" endIcon={<AddIcon />} className='button-style'>New Video</Button>
                            <Button variant="outlined" className='button-style'>Home</Button>
                            <Button variant="outlined" className='button-style'>Template</Button>
                            <Button variant="outlined" className='button-style'>All Videos</Button>
                        </Box>
                    </Item>
                </Grid>
                <Grid item xs={10} sx={{height:'100%'}}>
                    {/* <Item> */}
                        <Box>
                            <Grid container sx={{display:'flex', justifyContent:'center', alignItems:'center'}}>
                                <Grid item xs={11}>
                                    <SearchBar/>
                                </Grid>
                                <Grid item xs={1}>
                                    <Avatar sx={{ float:'center'}}>
                                        <PersonIcon />
                                    </Avatar>
                                </Grid>
                            </Grid>
                        </Box>
                    {/* </Item> */}
                    {/* <Item> */}
                    <Box sx={{ ml:'2%'}}>
                        <Grid container sx={{ display:'flex', flexWrap:'wrap', justifyContent: 'space-between'}}>
                            <Grid item>
                                <Button variant="outlined" startIcon={<ContentCutIcon />} className='button-style-2' sx={{ textTransform:'none'}} >Create Project</Button>
                                <Button variant="outlined" startIcon={<VideoCallIcon />} className='button-style-2'  sx={{ textTransform:'none', ml:'10px'}} >Record Video</Button>
                            </Grid>
                            <Grid item>
                                <Link variant="outlined" className='button-style-2'  sx={{ textTransform:'none', mr:'5rem', }} >All Videos {'>'}</Link>
                            </Grid>
                        </Grid>
                        <Box sx={{ mt:'2%', fontWeight:"bold"}}> 
                            <Typography variant='p' >Recent Videos</Typography>
                            <Grid container xs={12} sx={{ mt: '30px', display: 'flex', flexDirection: 'row', flexWrap: 'wrap' }}>

                                <Grid item xs={3} sx={{  marginBottom: '10px', marginRight: { xs: '10px', sm: '20px' } }}>
                                    {/* Content */}
                                    <Box sx={{ width: '100%', height: '200px', border: '1px solid black', backgroundColor: '#f0f0f0' }}>

                                    </Box>
                                    <Typography variant='p'>Project Name - 1</Typography>
                                </Grid>
                                <Grid item xs={3} sx={{  marginBottom: '10px', marginRight: { xs: '10px', sm: '20px' } }}>
                                    {/* Content */}
                                    <Box sx={{ width: '100%', height: '200px', border: '1px solid black', backgroundColor: '#f0f0f0' }}>

                                    </Box>
                                    <Typography variant='p'>Project Name - 2</Typography>
                                </Grid>
                                <Grid item xs={3} sx={{  marginBottom: '10px', marginRight: { xs: '10px', sm: '20px' } }}>
                                    {/* Content */}
                                    <Box sx={{ width: '100%', height: '200px', border: '1px solid black', backgroundColor: '#f0f0f0' }}>

                                    </Box>
                                    <Typography variant='p'>Project Name - 3</Typography>
                                </Grid>

                                <Grid item xs={3} sx={{  marginBottom: '10px', marginRight: { xs: '10px', sm: '20px' } }}>
                                    {/* Content */}
                                    <Box sx={{ width: '100%', height: '200px', border: '1px solid black', backgroundColor: '#f0f0f0' }}>

                                    </Box>
                                    <Typography variant='p'>Project Name - 1</Typography>
                                </Grid>
                                <Grid item xs={3} sx={{  marginBottom: '10px', marginRight: { xs: '10px', sm: '20px' } }}>
                                    {/* Content */}
                                    <Box sx={{ width: '100%', height: '200px', border: '1px solid black', backgroundColor: '#f0f0f0' }}>

                                    </Box>
                                    <Typography variant='p'>Project Name - 2</Typography>
                                </Grid>
                                <Grid item xs={3} sx={{  marginBottom: '10px', marginRight: { xs: '10px', sm: '20px' } }}>
                                    {/* Content */}
                                    <Box sx={{ width: '100%', height: '200px', border: '1px solid black', backgroundColor: '#f0f0f0' }}>

                                    </Box>
                                    <Typography variant='p'>Project Name - 3</Typography>
                                </Grid>
                            </Grid>

                        </Box>


                    </Box>
                    {/* </Item> */}
                </Grid>
                <Grid container> 
                    <Box sx={{ position: 'absolute', backgroundColor: 'gray', height: '5vh', width: '100%', bottom:'0' }}>
                        {/* Content */}
                    </Box>
                </Grid>
            </Grid>



        </>
    )
}
